'''luimë''' in [[Quenya]] means "flood" and "high tide" possibly used also for any tide, or for the spring tide<ref>{{VT|48}}</ref>

==Etymology==
Possible [[PQ]] form *''luimê'' from [[Sundocarmë|Root]] *LUY.

==Other versions==
Tolkien considered also the glosses "floodwater, flooded land" but they were struck out.

